script: |
  super -f text -I q867.spq | sort > q867.out

inputs:
  - name: q867.spq
    data: |
      SELECT d
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b)
      ORDER BY 1;
  - name: t1

outputs:
  - name: q867.out
    data: |
      190
      222
      248
